import axios from 'axios'
const api = {
    isInDb: loginObject =>
    {
        let data;
        console.log(loginObject);
        axios.post('/api/login', loginObject)
        .then((param) => {
            data = param;
        });
        console.log(data);
        return data;
    }, 


};
export default api;
